import { Link } from 'react-router-dom';

// Must be default export
export default function Navbar() {
  return (
    <nav className="bg-white shadow-sm">
      <div className="max-w-7xl mx-auto px-4 py-3 flex justify-between">
        <Link to="/" className="text-xl font-bold text-blue-600">HostelHub+</Link>
        <div className="flex space-x-4">
          <Link to="/attendance" className="px-3 py-2 text-gray-700 hover:text-blue-600">Attendance</Link>
          <Link to="/study-buddies" className="px-3 py-2 text-gray-700 hover:text-blue-600">Study Buddies</Link>
        </div>
      </div>
    </nav>
  );
}
